import React from 'react';
import '../../App.css';


export default function Avengers() {
  return <div>< h1 className='avengers'>Avengers</h1>
  <body className ="title">Loki, the adopted brother of Thor, teams-up with the Chitauri Army and uses the Tesseract's power to travel from Asgard to Midgard to plot the invasion of Earth and become a king. The director of the agency S.H.I.E.L.D., Nick Fury, sets in motion project Avengers, joining Tony Stark a.k.a. the Iron Man; Steve Rogers, a.k.a. Captain America; Bruce Banner, a.k.a. The Hulk; Thor; Natasha Romanoff, a.k.a. Black Widow; and Clint Barton, a.k.a. Hawkeye, to save the world from the powerful Loki and the alien invasion.</body>
  document.body.style.setProperty('background-color', 'lime');
  document.body.style.setProperty('color', 'black');

 ;
</div>
}
